import React, { useState } from 'react';
import { 
  Card, 
  CardContent, 
  Typography, 
  Box, 
  FormControl, 
  InputLabel, 
  Select, 
  MenuItem,
  Grid,
  Button,
  Chip,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions
} from '@mui/material';
import { 
  LineChart, 
  Line, 
  XAxis, 
  YAxis, 
  CartesianGrid, 
  Tooltip, 
  Legend, 
  ResponsiveContainer,
  ComposedChart,
  Bar,
  Area,
  Scatter
} from 'recharts';
import { Add, Settings } from '@mui/icons-material';

interface ChartData {
  date: string;
  sharePrice: number;
  ntPE: number;
  ntEPS: number;
}

const monthlyData: ChartData[] = [
  { date: '2023-01', sharePrice: 145, ntPE: 23, ntEPS: 6.0 },
  { date: '2023-02', sharePrice: 148, ntPE: 24, ntEPS: 6.1 },
  { date: '2023-03', sharePrice: 155, ntPE: 25, ntEPS: 6.2 },
  { date: '2023-04', sharePrice: 160, ntPE: 26, ntEPS: 6.3 },
  { date: '2023-05', sharePrice: 165, ntPE: 27, ntEPS: 6.4 },
  { date: '2023-06', sharePrice: 170, ntPE: 28, ntEPS: 6.5 },
  { date: '2023-07', sharePrice: 175, ntPE: 29, ntEPS: 6.6 },
  { date: '2023-08', sharePrice: 180, ntPE: 30, ntEPS: 6.7 },
  { date: '2023-09', sharePrice: 185, ntPE: 31, ntEPS: 6.8 },
  { date: '2023-10', sharePrice: 190, ntPE: 32, ntEPS: 6.9 },
  { date: '2023-11', sharePrice: 192, ntPE: 33, ntEPS: 7.0 },
  { date: '2023-12', sharePrice: 195, ntPE: 34, ntEPS: 7.1 },
];

const axisOptions = [
  { value: 'sharePrice', label: 'Share Price (LHS)', color: '#0071e3', axis: 'left' },
  { value: 'ntPE', label: 'NTM P/E (RHS1)', color: '#1db954', axis: 'right1' },
  { value: 'ntEPS', label: 'NTM EPS (RHS2)', color: '#ff9800', axis: 'right2' },
];

const ChartSection: React.FC = () => {
  const [xAxis] = useState<string>('date');
  const [yAxis1, setYAxis1] = useState<string>('sharePrice');
  const [yAxis2, setYAxis2] = useState<string>('ntPE');
  const [yAxis3, setYAxis3] = useState<string>('ntEPS');
  const [customizeOpen, setCustomizeOpen] = useState(false);

  const getAxisLabel = (value: string): string => {
    const option = axisOptions.find(opt => opt.value === value);
    return option ? option.label : value;
  };
  const getAxisColor = (value: string): string => {
    const option = axisOptions.find(opt => opt.value === value);
    return option ? option.color : '#8884d8';
  };

  return (
    <Card sx={{ mb: 3, borderRadius: 3, boxShadow: '0 2px 8px rgba(0,0,0,0.04)', border: '1px solid #e0e0e0', background: '#fff' }}>
      <CardContent sx={{ p: 2 }}>
        <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
          <Typography variant="h6" sx={{ fontWeight: 700, color: '#111', flexGrow: 1 }}>
            Interactive Chart
          </Typography>
          <Button
            variant="outlined"
            startIcon={<Settings />}
            onClick={() => setCustomizeOpen(true)}
            sx={{ borderRadius: 2, fontWeight: 600, color: '#0071e3', border: '1px solid #0071e3', ml: 1 }}
          >
            Customizable
          </Button>
        </Box>
        <Box sx={{ height: 340, width: '100%' }}>
          <ResponsiveContainer width="100%" height="100%">
            <LineChart data={monthlyData} margin={{ top: 20, right: 60, left: 20, bottom: 5 }}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey={xAxis} />
              <YAxis yAxisId="left" stroke={getAxisColor(yAxis1)} />
              <YAxis yAxisId="right1" orientation="right" stroke={getAxisColor(yAxis2)} />
              <YAxis yAxisId="right2" orientation="right" stroke={getAxisColor(yAxis3)} />
              <Tooltip />
              <Legend formatter={(value) => {
                if (value === yAxis1) return getAxisLabel(yAxis1);
                if (value === yAxis2) return getAxisLabel(yAxis2);
                if (value === yAxis3) return getAxisLabel(yAxis3);
                return value;
              }} />
              <Line yAxisId="left" type="monotone" dataKey={yAxis1} stroke={getAxisColor(yAxis1)} name={getAxisLabel(yAxis1)} dot={false} strokeWidth={2.5} />
              <Line yAxisId="right1" type="monotone" dataKey={yAxis2} stroke={getAxisColor(yAxis2)} name={getAxisLabel(yAxis2)} dot={false} strokeWidth={2.5} />
              <Line yAxisId="right2" type="monotone" dataKey={yAxis3} stroke={getAxisColor(yAxis3)} name={getAxisLabel(yAxis3)} dot={false} strokeWidth={2.5} />
            </LineChart>
          </ResponsiveContainer>
        </Box>
        <Dialog open={customizeOpen} onClose={() => setCustomizeOpen(false)} maxWidth="sm" fullWidth>
          <DialogTitle>Customize Chart Axes</DialogTitle>
          <DialogContent>
            <Grid container spacing={2} sx={{ mt: 1 }}>
              <Grid item xs={12} md={4}>
                <FormControl fullWidth size="small">
                  <InputLabel>Y-Axis (LHS)</InputLabel>
                  <Select
                    value={yAxis1}
                    label="Y-Axis (LHS)"
                    onChange={(e) => setYAxis1(e.target.value)}
                  >
                    {axisOptions.map((option) => (
                      <MenuItem key={option.value} value={option.value}>
                        {option.label}
                      </MenuItem>
                    ))}
                  </Select>
                </FormControl>
              </Grid>
              <Grid item xs={12} md={4}>
                <FormControl fullWidth size="small">
                  <InputLabel>Y-Axis (RHS1)</InputLabel>
                  <Select
                    value={yAxis2}
                    label="Y-Axis (RHS1)"
                    onChange={(e) => setYAxis2(e.target.value)}
                  >
                    {axisOptions.map((option) => (
                      <MenuItem key={option.value} value={option.value}>
                        {option.label}
                      </MenuItem>
                    ))}
                  </Select>
                </FormControl>
              </Grid>
              <Grid item xs={12} md={4}>
                <FormControl fullWidth size="small">
                  <InputLabel>Y-Axis (RHS2)</InputLabel>
                  <Select
                    value={yAxis3}
                    label="Y-Axis (RHS2)"
                    onChange={(e) => setYAxis3(e.target.value)}
                  >
                    {axisOptions.map((option) => (
                      <MenuItem key={option.value} value={option.value}>
                        {option.label}
                      </MenuItem>
                    ))}
                  </Select>
                </FormControl>
              </Grid>
            </Grid>
          </DialogContent>
          <DialogActions>
            <Button onClick={() => setCustomizeOpen(false)} color="primary" variant="contained">
              Done
            </Button>
          </DialogActions>
        </Dialog>
      </CardContent>
    </Card>
  );
};

export default ChartSection;
